INSERT INTO `book` VALUES (125, '红楼梦', 10, '曹雪芹', '人民出版社', 4, '《红楼梦》书叙西方灵河岸上三生石畔的绛珠仙子，为了酬报神瑛侍者的灌溉之恩，要将毕生的泪水偿还，就随其下凡历劫。宝玉为神瑛侍者转世，林黛玉为绛珠仙子转世，这段姻缘称为“木石前盟”。远古女娲炼石补天遗下的顽石，通灵性，为贾宝玉出世时所衔的“通灵宝玉”，“通灵宝玉”历尽世间辛酸悲欢的故事，就是《石头记》，亦即《红楼梦》。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/8e174c8f-2ec5-4c6b-bddc-282b63c2b95c');
INSERT INTO `book` VALUES (126, '红楼梦', 9, '曹雪芹', '钢铁出版社', 1, '《红楼梦》故事纷纭复杂，其较大的事件有：黛玉丧母，进京依附外祖母；宝玉母姨及其子薛蟠、女薛宝钗进驻贾府.....', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/cfbcf26e-f613-4eb8-a3f7-d4b15220a85e');
