INSERT INTO `book` VALUES (128, '解忧杂货店', 22, '日] 东野圭吾 ', '斜向上出版社', 3, '现代人内心流失的东西，这家杂货店能帮你找回—— 僻静的街道旁有一家杂货店，只要写下烦恼投进卷帘门的投信口，第二天就会在店后的牛奶箱里得到回答。 因男友身患绝症，年轻女孩静子在爱情与梦想间徘徊；克郎为了音乐梦想离家漂泊，却在现实中寸步难行；少年浩介面临家庭巨变，挣扎在亲情与未来的迷茫中…… 他们将困惑写成信投进杂货店，随即奇妙的事情竟', 'http://sh4kj2q5q.hn-bkt.clouddn.com/%E7%B3%BB%E7%BB%9F%E5%9B%BE%E7%89%87/Book.jpg');
INSERT INTO `book` VALUES (129, '杀死一只知更鸟', 8, '森下孝三', '市场上赤发', 4, '《杀死一只知更鸟》是美国女作家哈珀·李发表于1960年的长篇小说。\n该小说讲述一个名叫汤姆·鲁滨逊的年轻人，被人诬告犯了强奸罪后，只是因为是一个黑人，辩护律师阿蒂克斯·芬奇尽管握有汤姆不是强奸犯的证据，都无法阻止陪审团给出汤姆有罪的结论。此一妄加之罪，导致汤姆死于乱枪之下。 [1]虽然故事题材涉及种族不平等与强暴等严肃议题，其文风仍温暖风趣。小说以第一人称著成，叙述者的父亲阿蒂克斯·芬奇在书中为道德端正的角色，亦是正直律师的典范。\n1961年，该书获当年度普利策奖，被翻译成四十多种语言，在世界范围内售出超过三千万册，同年被改编成同名电影。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/299ba67b-7b48-41d0-8bb2-ac612f57bd04');
INSERT INTO `book` VALUES (130, '百年孤独', 9, '加西亚·马尔克斯', '献爱心阿达出版社', 3, '《百年孤独》，是哥伦比亚作家加西亚·马尔克斯创作的长篇小说，是其代表作，也是拉丁美洲魔幻现实主义文学的代表作，被誉为“再现拉丁美洲历史社会图景的鸿篇巨著”。\n故事讲述马孔多小镇和布恩地亚家族的兴衰变化与传奇故事，记录了家族命运与百年历史，是重复地叙述相同而荒唐的命运，是拉美国家几百年命运的缩影，独具意味地隐喻着人类“文明”史的建立、发展与终结，在荒凉失落与荒唐可笑中诠释宿命式的轮回。家族中人物名字是相同或相近的，预示着他们拥有殊途同归的孤独命运。《百年孤独》以布恩地亚被捆在树上为开端，以他被蚂蚁吃掉为结束，通过细腻丰富的笔触、大胆自由的想象、魔幻的叙事艺术，讲述布恩地亚家族命运与历史，刻画人物孤独的灵魂与自我救赎，进而体现出个人、家族及全人类的悲悯与孤独情怀，让人们重新思考时代发展与人性变化。 [17]\n《百年孤独》被世界文坛誉为魔幻现实主义文学的主峰，已被翻译成30多种文字出版，销量逾1000万册。 [', 'http://sh4kj2q5q.hn-bkt.clouddn.com/%E7%B3%BB%E7%BB%9F%E5%9B%BE%E7%89%87/Book.jpg');
INSERT INTO `book` VALUES (131, '枯枝败叶', 9, '加西亚·马尔克斯', '发顺丰sss', 5, '《枯枝败叶》是加西亚·马尔克斯出版于1955年的处女作，也是《百年孤独》的雏形，从此小镇马孔多成为马尔克斯笔下最知名的地标。加夫列尔·加西亚·马尔克斯，1982年诺贝尔文学奖获得者。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/%E7%B3%BB%E7%BB%9F%E5%9B%BE%E7%89%87/Book.jpg');
INSERT INTO `book` VALUES (132, '枯枝败叶', 9, '加西亚·马尔克斯', '打发打发出版社', 5, '《枯枝败叶》是加西亚·马尔克斯出版于1955年的处女作，也是《百年孤独》的雏形，从此小镇马孔多成为马尔克斯笔下最知名的地标。加夫列尔·加西亚·马尔克斯，1982年诺贝尔文学奖获得者。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/7a017724-b1a8-4cdb-a36f-201312c27318');
INSERT INTO `book` VALUES (133, '枯枝败叶', 9, '撒大苏打撒旦', '撒大苏打', 1, '《杀死一只知更鸟》是美国女作家哈珀·李发表于1960年的长篇小说。\n该小说讲述一个名叫汤姆·鲁滨逊的年轻人，被人诬告犯了强奸罪后，只是因为是一个黑人，辩护律师阿蒂克斯·芬奇尽管握有汤姆不是强奸犯的证据，都无法阻止陪审团给出汤姆有罪的结论。此一妄加之罪，导致汤姆死于乱枪之下。 [1]虽然故事题材涉及种族不平等与强暴等严肃议题，其文风仍温暖风趣。小说以第一人称著成，叙述者的父亲阿蒂克斯·芬奇在书中为道德端正的角色，亦是正直律师的典范。\n1961年，该书获当年度普利策奖，被翻译成四十多种语言，在世界范围内售出超过三千万册，同年被改编成同名电影。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/f04828c2-2fa1-48cb-a471-e8315a0bbd57');
INSERT INTO `book` VALUES (134, '霍乱时期的爱情', 9, '加西亚·马尔克斯', '撒大苏打撒旦', 3, '《霍乱时期的爱情》是哥伦比亚作家加西亚·马尔克斯创作的长篇小说，首次出版于1985年。\n该小说讲述了一段跨越半个多世纪的爱情故事：男女主人公在二十岁的时候没能结婚，因为他们太年轻了；经过各种人生曲折之后，到了八十岁，他们还是没能结婚，因为他们太老了。在五十年的时间跨度中，作者展示了所有爱情的可能性，所有的爱情方式。该小说不仅表达了“经历爱情的折磨是一种尊严”，更重要的是展现了哥伦比亚的历史。战争和霍乱威胁着拉美人民的生命，而人为的破坏加剧了人与自然的对立，人的社会孤独感使人与人之间缺乏理解信任，心理距离加大。 [1]\n1985年，该小说出版，立即在拉美文坛上引起巨大反响，第一版即出书120万册，销售一空；围绕小说的评论更是连篇累牍。世界各国纷纷翻译出版。', 'http://sh4kj2q5q.hn-bkt.clouddn.com/2024-8/13e92876-ddf6-471b-bb50-ce8dac7d3f47');
